INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name, preicoend, preicostart, rating, website_link) VALUES (4199, 'Virtual Rehab''s evidence-based solution leverages the advancements in virtual reality, artificial intelligence, and blockchain technologies for pain management, prevention of substance use disorders, and rehabilitation of repeat offenders. \r\n\r\nOur all-encompassing solution currently serves the B2B market (Rehab Centers, Hospitals, Correctional Departments, etc.).\r\n\r\nIn addition, post-ICO, using blockchain technology, we will also be able to reach out to these vulnerable populations direc...', 'Using VR, AI, and Blockchain technologies to provide psychological rehabilitation for vulnerable populations.', '2018-12-14 22:00:00.000000', '2018-11-15 13:00:00.000000', 'https://icobench.com/images/icos/icons/virtual-rehab.jpg', 'Virtual Rehab',  '2018-11-14 22:00:00.000000', '2018-11-01 13:00:00.000000', 4.6, 'https://icobench.com/ico/virtual-rehab');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (3478, 'ZZichain provides a suite of modules for cryptocurrency financial services. Our infrastructure solutions are tailored for managing digital assets: from retail trading to institutional wealth management.\r\n\r\nZichain modules unleash the potential of fintech and maximize advantages of blockchain, big data, and AI. Our research and development activity in blockchain is aimed to eliminate a counterparty risk by building infrastructure for decentralized storage of assets. The fintech services are b...', 'Your gateway to the world of crypto finance.', '2018-12-22 00:00:00.000000', '2018-12-01 00:00:00.000000', 'https://icobench.com/images/icos/icons/zichain.jpg', 'Zichain',  '2018-10-15 00:00:00.000000', '2018-04-02 00:00:00.000000', 4.3, 'https://icobench.com/ico/zichain');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (2299, 'This platform will be open to anyone owning Aeternum Token not just a select group of investors and no contribution will be too small to reap the return from deep science project realisation.\r\n\r\nInvest in deep science based start-ups through a crowd funding platform accessible by a smart phone app for every ecosystem user. Investments in Aeternum Fund will be made only through the new cryptocurrency “BitLats” and companies will be able to exit by buying themselves out with BitLats. BitLats w...', 'Our goal is to create a platform, through which every individual will be able to invest in intellectual property rights of scientists around the world.', '2018-10-31 10:00:00.000000', '2018-06-01 10:00:00.000000', 'https://icobench.com/images/icos/icons/aeternum-ico.jpg', 'Aeternum ICO',  '2018-04-30 10:00:00.000000', '2018-04-02 10:00:00.000000', 4.4, 'https://icobench.com/ico/aeternum-ico');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (2183, 'ARROUND is a decentralized augmented reality (AR) platform. ARROUND uses blockchain and augmented reality to build an ecosystem consisting of four integrated elements: a disruptive universal advertising network, an augmented reality marketplace, a social platform, and the next generation AR map that will create a backbone for AR projects around the world.\r\n\r\nARROUND offers a disruptive and fully functional AR social platform available for iOS and Android, which will also be ported to consume...', 'ARROUND is a decentralized augmented reality (AR) platform that provides the world with a captivating new digital environment to explore.', '2018-11-15 03:59:00.000000', '2018-09-15 13:00:00.000000', 'https://icobench.com/images/icos/icons/arround.jpg', 'ARROUND',  '2018-05-01 00:00:00.000000', '2018-02-27 00:00:00.000000', 4.6, 'https://icobench.com/ico/arround');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (3679, 'Insurance is broken: it''s expensive, complicated and slow to meet customer needs. It''s because all decisions are made by a handful of people in a small number of big insurance companies, riddled with bureaucracy.\r\n\r\nBlack is going to fix insurance by introducing a democratic, blockchain-based marketplace for creating virtual insurance companies that can design and sell their own, innovative insurance products. These products will be backed by security tokens issued in the future ICO-s, allow...', 'Insurance is broken: it''s expensive, complicated and slow to meet customer needs.', '2018-11-30 00:00:00.000000', '2018-11-01 00:00:00.000000', 'https://icobench.com/images/icos/icons/black-insurance.jpg', 'Black Insurance',  '2018-10-31 00:00:00.000000', '2018-10-01 00:00:00.000000', 4.4, 'https://icobench.com/ico/black-insurance');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (4634, 'BQT P2P Exchange Platform provides secure, interactive and flexible trading environment and user-friendly interface for its community to manage various types of transactions consisting of many crypto assets in traders portfolios.\r\n\r\nBQT introducing the revolutionary approach allowing traders to leverage their crypto holdings to acquire crypto assets from other peer traders. Unlike Margins and Futures Trading, BQT Hedge Trade system is a flexible method for Traders of acquiring crypto assets ...', 'BQT P2P Exchange Platform provides secure, interactive and flexible trading environment and user-friendly interface for its community.', '2018-12-18 00:00:00.000000', '2018-09-18 00:00:00.000000', 'https://icobench.com/images/icos/icons/bqt.jpg', 'BQT',  '2018-09-18 00:00:00.000000', '2018-08-18 00:00:00.000000', 4, 'https://icobench.com/ico/bqt');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (3942, 'Cloudbric is a decentralized universal security platform featuring enterprise-grade website, mobile device and crypto asset security, as well as access to a community driven threat intelligence database all powered through a new technology called VISION (patent pending), a CNN-based deep learning AI-tech, featuring one of the most accurate (low false positive rated) engines on the market. \r\n\r\nOur goal is to not only secure the web in general, but to secure the entire blockchain experience fo...', 'We are a trusted enterprise level security vendor with various awards & thousands of users, looking to better protect users within the blockchain space.', '2018-10-31 11:00:00.000000', '2018-10-22 11:00:00.000000', 'https://icobench.com/images/icos/icons/cloudbric.jpg', 'Cloudbric',  '2018-09-22 07:00:00.000000', '2018-08-23 07:00:00.000000', 4.4, 'https://icobench.com/ico/cloudbric');
INSERT INTO public.ico (id, intro, description, icoend, icostart, logolink, name,  preicoend, preicostart, rating, website_link) VALUES (4948, 'cosquare is a global social marketplace with its own CSQ digital currency. Merging the worlds of blockchain technology, social media and e-commerce, cosquare is on a mission to create a richer shopping experience for consumers, influencers and brands. The gamified shopping ecosystem empowers people to earn and liberates brands to sell direct-to-consumer.\r\n\r\ncosquare makes cryptocurrency payments mainstream, accepting CSQ and all major crypto and fiat currencies. Committed to transparency tow...', 'cosquare is a global social marketplace with its own CSQ currency. We are on a mission to make shopping truly social and rewarding.', '2019-04-14 00:00:00.000000', '2018-11-15 00:00:00.000000', 'https://icobench.com/images/icos/icons/cosquare.jpg', 'cosquare', '2018-11-14 00:00:00.000000', '2018-09-15 00:00:00.000000', 3.7, 'https://icobench.com/ico/cosquare');
